ber 18, 2018\n\u001c157\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI believe the future of learning and education is the internet. People can answer back and interact. In a way, the internet connects us all together like the neurons in a giant brain.\n\nNovember 18, 2018\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI am advocating that all young people should be familiar with and confident around scientific subjects, whatever they choose to do. They need to be scientifically literate, and inspired to engage with developments in science and technology in order to learn more.\n\nNovember 18, 2018\n\u001c161\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo remember to look up at the stars and not down at your feet. Try to make sense of what you see and wonder about what makes the universe exist. Be curious. And however difficult life may seem, there is always something you can do and succeed at. It matters that you don’t just give up. Unleash your imagination. Shape the future.\n\nNovember 18, 2018\n\u001c163\n\u0011\n\u0011"}
}'



